import React from "react";
import { Col, Row } from 'react-bootstrap';

const TotalBayar = ({ keranjangs }) => {
	console.log(keranjangs);
	return (
		<div className="fixed-bottom">
			<Row>
				<Col lx={{span: 3, offset: 9}}>
					<h4>TotalBayar</h4>
				</Col>
			</Row>
		</div>
	);
};

export default TotalBayar;
